import React, { useState, useEffect } from 'react';

function Feed() {
    const [feed, setFeed] = useState([])

    useEffect(() => {
        fetch("http://localhost:5000/send_feed", {
            'method': 'POST',
            headers: {
                'Content-Type': 'application/json'
            }
        })
            .then(res => res.json())
            .then(feed => {
                setFeed(feed)
                console.log(feed)
                })
    }, [])


  return (
    <div>Feed</div>
  )
}

export default Feed
